import React from "react";
//Styles
import "./Icons.css";
type props = {
	title: string;
};

const Icons: React.FC<props> = ({ title }) => {
	return (
		<div className='icon-container'>
			<span>{title}</span>
		</div>
	);
};

export default Icons;
